import React, { useState, FormEvent } from 'react';
import { Form, Button, Alert, Container, Row, Col } from 'react-bootstrap';
import { CharacterClass, CharacterRace, CharacterFormData } from '../../types/character';
import { ClassGrid } from './ClassGrid';
import { StatsTable } from './CharacterStats';

interface CharacterFormProps {
    classes: CharacterClass[];
    races: CharacterRace[];
    onSubmit: (data: CharacterFormData) => Promise<void>;
    onCancel: () => void;
    error?: string;
}

export const CharacterForm: React.FC<CharacterFormProps> = ({ 
    classes, 
    races, 
    onSubmit,
    onCancel,
    error 
}) => {
    const [selectedClassId, setSelectedClassId] = useState<number | null>(null);
    const [formData, setFormData] = useState<CharacterFormData>({
        name: '',
        class: '',
        race: '',
        sex: ''
    });

    const selectedClass = classes.find(c => c.id === selectedClassId);

    const handleSubmit = async (e: FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        await onSubmit(formData);
    };

    const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    return (
        <Container fluid>
            <Form onSubmit={handleSubmit}>
                {error && (
                    <Alert variant="danger" className="mb-4">
                        {error}
                    </Alert>
                )}

                <Row>
                    <Col md={8}>
                        <ClassGrid 
                            classes={classes}
                            selectedClassId={selectedClassId}
                            onSelectClass={(classId) => {
                                setSelectedClassId(classId);
                                setFormData(prev => ({ ...prev, class: classId.toString() }));
                            }}
                        />
                    </Col>
                    <Col md={4}>
                        {selectedClass && (
                            <StatsTable 
                                baseStats={selectedClass.baseStats}
                                maxStats={selectedClass.maxStats}
                            />
                        )}
                    </Col>
                </Row>

                <Row className="mt-4">
                    <Col md={12}>
                        <Form.Group className="mb-3">
                            <Form.Label>Character Name</Form.Label>
                            <Form.Control
                                type="text"
                                name="name"
                                value={formData.name}
                                onChange={handleChange}
                                required
                            />
                        </Form.Group>
                    </Col>
                </Row>

                <Row>
                    <Col md={6}>
                        <Form.Group className="mb-3">
                            <Form.Label>Race</Form.Label>
                            <Form.Select
                                name="race"
                                value={formData.race}
                                onChange={handleChange}
                                required
                            >
                                <option value="">Select a race</option>
                                {races.map(r => (
                                    <option key={r.id} value={r.id}>
                                        {r.name}
                                    </option>
                                ))}
                            </Form.Select>
                        </Form.Group>
                    </Col>
                    <Col md={6}>
                        <Form.Group className="mb-3">
                            <Form.Label>Sex</Form.Label>
                            <Form.Select
                                name="sex"
                                value={formData.sex}
                                onChange={handleChange}
                                required
                            >
                                <option value="">Select sex</option>
                                <option value="M">Male</option>
                                <option value="F">Female</option>
                            </Form.Select>
                        </Form.Group>
                    </Col>
                </Row>

                <Row className="mt-4">
                    <Col md={6}>
                        <Button variant="primary" type="submit" className="w-100">
                            Create Character
                        </Button>
                    </Col>
                    <Col md={6}>
                        <Button variant="secondary" type="button" className="w-100" onClick={onCancel}>
                            Back to Menu
                        </Button>
                    </Col>
                </Row>
            </Form>
        </Container>
    );
};
